import axios from 'axios'

const AlbumList = () => {
    const [albums,setAlbums]=useState([])

    const fetchAlbums=()=>{
        const headers={
            "Accept": "application/json" ,
            'Content-Type': "application/json" ,
            "Authorization": "Bearer BQAk-d-8kkJIjUEzIzQpWwHXnUU-gmK0t7iZXYMmTqO2k1mZyj0oWbCcm9Q_1teOk5RxFdekuMTW06YsHedXZJosirMr5CSRKZkO6PgpO-ieKYs2u9-iigDPz3oZfihBYHWQTA2yvL5icSnmbZFeAi93pyQylPG-2Qcr"}
        const url='https://api.spotify.com/v1/albums?ids=382ObEPsp2rxGrnsizN5TX%2C1A2GTWGtFfWp7KSQTwWOyo%2C2noRn2Aes5aoNVsU6iWThc&market=ES'

        axios.get(url,{headers:headers})
        .then((response)=>{
            setAlbums(response.data.albums)
        })
        .catch((err)=>console.log(err.message))


    }

    useEffect(()=>{
        fetchAlbums()
    },[])


    return (
        <div className="d-flex">
            {
                albums.map((album)=>{
                    console.log(albums)
                    return <div class="card" style={{width: "18rem"}} key={album.id}>
                        <img alt={album.name} class="card-img-top" src={album.images[0].url} />
                        <div class="card-body">
                            <h5 className="card-title">{album.name}</h5>
                            <p class="card-text">{album.label}</p>
                            <a href="#" class="btn btn-primary-outlined"></a>
                        </div>
                    </div>
                })
            }
        </div>
    )
}

export default AlbumList
